import React from "react";

import LogIn from "./LogIn"

let isLoggedIn = false;

const renderConditionally = (props) => {
  console.log(props)
  if (isLoggedIn){
    return  <h1>Hello</h1>
  } else {
    return (
      <LogIn 
      />
    );
  }
}

function App() {
  return  <div className="container">{renderConditionally()}</div>;
}

export default App;
